import React from "react";
import "./Navbar.css"
function Navbar(){
    return(
        <>
            <div className="navbar">
                <div className="logo">
                <img src="https://bitbucket.org/punitdiwan/coding-challange/raw/422d739e95063be2ad555486c6d207c92a9977ff/assets/restaurant_24px.svg" alt='restro'/>
                <h4>Food's Restaurant</h4>
                </div>
            </div>
        </>
    )
}
export default Navbar;
